import React from 'react';
import logo from './logo.svg';
import './App.css';
import Chart from './components/Chart'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://i.kym-cdn.com/entries/icons/original/000/013/564/doge.jpg" className="App-logo" alt="logo" />
        
        <Chart />

      </header>
    </div>
  );
}

export default App;
